import React from 'react';
import { Center, FlatList, Text } from 'native-base';
import products from '../data/Products';

function OrderItem() {
  return (
    <FlatList showsVerticalScrollIndicator={false} data={products.slice(0,3)}>

    </FlatList>
  );
}

export default OrderItem;
